import React, { Component } from "react";
import { Row, Col } from 'react-bootstrap';
import '../styles/header.css';

export class Header extends Component {
    render() {
        return (
            <Row id='headerRow1'>
                <img src='EU_hz-rev.png'></img>
            </Row>
        )
    }
}

export default Header;
